package com.soch.Integra.vendors.dto;

public class HostingTypeDTO {

	private Integer hostingTypeId;
	private String name;
	private String desc;
	public Integer getHostingTypeId() {
		return hostingTypeId;
	}
	public void setHostingTypeId(Integer hostingTypeId) {
		this.hostingTypeId = hostingTypeId;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getDesc() {
		return desc;
	}
	public void setDesc(String desc) {
		this.desc = desc;
	}
	
}
